/**
 * 将字符串转成成烤肉串命名规则字符串，例如 `hello-world`.
 * @since 1.0.0
 * @Catalog String
 * @param [str = ''] (string): 待转换的字符串
 * @returns (string): 烤肉串命名规则字符串
 * @example
 * _.kebabCase('Foo Bar');
 * // => 'foo-bar'
 *
 * _.kebabCase('fooBar');
 * // => 'foo-bar'
 *
 * _.kebabCase('__FOO_BAR__');
 * // => 'foo-bar'
 */
export default function kebabCase(str?: any): string;
